import React from "react";
import ReactDOM from "react-dom";
import SkillSet from "./SkillSet";
import "../componentCss/SkillListCss.css";

class SkillList extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="grid wide skill-list-wrapper">
        <div className="row">
          <SkillSet skillName="OOP" skillDescription="lorem" />
          <SkillSet
            skillName="Cấu trúc dữ liệu & giải thuật"
            skillDescription="lorem"
          />
          <SkillSet
            skillName="HTML5, CSS3, ES6 và hơn thế nữa!"
            skillDescription="lorem"
          />
          <SkillSet
            skillName="ReactJS, Bootstrap 4, Vue 3 và cả Angular 8"
            skillDescription="lorem"
          />
        </div>
      </div>
    );
  }
}

export default SkillList;
